import React from 'react'

function Graphic(){
    return (
            <div>
                <h1>Graphic Design</h1>
                <div>
                    <h2>FNZ's 2022 Graduate Recruitment Campaign</h2>
                    <img 
                        alt="FNZ Graduate Campaign, Sample 1" 
                        src={".../img/fnz1.jpg"}
                    />
                </div>
            </div>
    )
}


export default Graphic
